import './Stats.css';
import country_data from '../country_data.json';
import gdp_data from '../country_gdp.json';
import pop_data from '../country_pop.json';
import LandArea from "./LandArea";
import TotalCountries from './TotalCountries';
import GDP from './MinMax';

function Stats({ mapState }) {
  return (
    <div className="Stats">
      <LandArea mapState={mapState} country_data={country_data} />
      <TotalCountries mapState={mapState} />
      <GDP mapState={mapState} country_data={country_data} country_gdp={gdp_data} comp_index={"unGDP"} min_max={1} text={"üí∏ üìàHighest GDP:"}/>
      <GDP mapState={mapState} country_data={country_data} country_gdp={gdp_data} comp_index={"unGDP"} min_max={0} text={"üí∏üìâ Lowest GDP:"}/>
      <GDP mapState={mapState} country_data={country_data} country_gdp={pop_data} comp_index={"population"} min_max={1} text={"üåÜ Highest Population:"}/>
      <GDP mapState={mapState} country_data={country_data} country_gdp={pop_data} comp_index={"population"} min_max={0} text={"üèï Lowest Population:"}/>

    </div>
  )
}

  export default Stats
